import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

let date= new Date();

let greeting = "";
const css= {
    // color: "red",
    display: "grid",
    placeItems: "center",
    fontWeight: "bold",
    height: "100vh",
    width: "100vw",
    backgroundColor: "lightBlue",
    fontSize: "xxLarge"
}
let greet= {
    color: "blue",
    
    backgroundColor: "brown",
    fontSize: "Larger"
}
let crrhour=date.getHours();

if (crrhour==20) {
    
    greeting="its 20";
    greet.color="white";


    
}


ReactDOM.render(
  <>
     <div style={css}>
        <p>hello sir <span style={greet}>{greeting}  </span></p>
     </div>
  </>,
  document.getElementById('root')
);
